(1,	'published',	NULL,	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2021-12-14 13:03:09',	'f8a9bb57-86d6-4978-b676-71e27d1e5ee0',	'2022-04-04 10:01:30',	'Les Portes',	'# Les Portes\n\n**Bienvenue dans la zone des portes**\n\nLorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\n\nQuelques images :\n![](http://docketu.iutnc.univ-lorraine.fr:62007/assets/d9a4550c-dd54-4976-8f2b-b9ba0dfbe7ef)\n![](http://docketu.iutnc.univ-lorraine.fr:62007/assets/ce700286-2b0c-416b-8f31-0da92f0822e3)\n![](http://docketu.iutnc.univ-lorraine.fr:62007/assets/3117b4a4-f530-4274-851b-76c759741cd4?access_token=public_mine_token)\n\n\n*Dates clés*\n- xxxx\n- xxxx\n- xxxx\n',	'Gérant_1',	'e26d7f2b-fd32-419e-9906-84b0baab63c9',	NULL,	1,	NULL),
