(17,	'published',	NULL,	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-02-23 10:58:15',	'f8a9bb57-86d6-4978-b676-71e27d1e5ee0',	'2022-04-04 10:02:45',	'Accumulateur',	'# Zone de l\'accumulateur\nBienvenu dans la zone de l\'accumulateur\n',	'Marcel',	NULL,	NULL,	3,	NULL),
(27,	'published',	NULL,	'f8a9bb57-86d6-4978-b676-71e27d1e5ee0',	'2022-02-23 16:38:59',	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-04-04 13:48:53',	'Terrain Mine de Fer',	'# Bienvenue sur le terrain de la Mine de Fer de Neuves-Maisons\nVous êtes actuellement sur le terrain de la mine de fer de Neuves-Maisons (54) en France. \n\nLa mine de Neuves-Maisons ou Mine du Val de Fer ou Mine Maron-Val de Fer est une exploitation minière de fer dont les entrées sont situées à Neuves-Maisons, ainsi que Chaligny et Maron, en limite de la forêt de Haye, dans le département de Meurthe-et-Moselle, en Lorraine. La mine a été exploitée de 1874 jusqu\'à 1968.',	'Gérant Principal',	NULL,	NULL,	NULL,	1),
(38,	'published',	NULL,	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-03-03 13:45:57',	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-03-03 14:07:47',	'Article borne entrée 1',	'* Bienvenue sur le Terrain Mine de fer\n** Article pour la borne de l\'entrée ',	'gerant_2',	'8b349ffc-ad37-46c1-a858-6a03f0c55bc0',	NULL,	NULL,	NULL),
(39,	'published',	NULL,	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-04-02 16:37:23',	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-04-04 12:07:44',	'Entrée',	'Ceci est l\'article de la borne correspondante à une deuxième entrée de la mine.',	'Gerant 2',	NULL,	9,	NULL,	NULL),
(40,	'published',	NULL,	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-04-02 17:23:01',	'57ea7128-f207-48d9-89b1-4e9ef999b40c',	'2022-04-04 12:07:51',	'Article borne entrée n°2',	'L\'histoire de cette partie de la mine de fer est très intéressante : Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent euismod tincidunt leo volutpat semper. Fusce dictum maximus ipsum, sed semper nisi pharetra in. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Fusce cursus vulputate urna vitae tincidunt. Praesent quis tortor sed dolor vestibulum auctor. Fusce vehicula massa non enim aliquam, eu feugiat eros placerat. Vestibulum sagittis metus sed nisi pharetra laoreet. Etiam in cursus dui, id auctor risus. Curabitur tempus nulla sed purus molestie tristique. Sed facilisis nec tortor vel interdum. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae; ',	'Gerant 2',	NULL,	10,	NULL,	NULL),
