(888,	1127,	'article',	'27',	'{\"id\": 27, \"sort\": null, \"zone\": null, \"borne\": null, \"titre\": \"Terrain Mine de Fer\", \"auteur\": \"Gérant Principal\", \"status\": \"published\", \"contenu\": \"# Bienvenue sur le terrain de la Mine de Fer de Neuves-Maisons\\nVous êtes actuellement sur le terrain de la mine de fer de Neuves-Maisons (54) en France. \\n\\nLa mine de Neuves-Maisons ou Mine du Val de Fer ou Mine Maron-Val de Fer est une exploitation minière de fer dont les entrées sont situées à Neuves-Maisons, ainsi que Chaligny et Maron, en limite de la forêt de Haye, dans le département de Meurthe-et-Moselle, en Lorraine. La mine a été exploitée de 1874 jusqu\'à 1968.\", \"terrain\": 1, \"date_created\": \"2022-02-23T16:38:59.000Z\", \"date_updated\": \"2022-04-04T10:05:06.000Z\", \"image_header\": null, \"user_created\": \"f8a9bb57-86d6-4978-b676-71e27d1e5ee0\", \"user_updated\": \"f8a9bb57-86d6-4978-b676-71e27d1e5ee0\"}',	'{\"titre\": \"Terrain Mine de Fer\", \"contenu\": \"# Bienvenue sur le terrain de la Mine de Fer de Neuves-Maisons\\nVous êtes actuellement sur le terrain de la mine de fer de Neuves-Maisons (54) en France. \\n\\nLa mine de Neuves-Maisons ou Mine du Val de Fer ou Mine Maron-Val de Fer est une exploitation minière de fer dont les entrées sont situées à Neuves-Maisons, ainsi que Chaligny et Maron, en limite de la forêt de Haye, dans le département de Meurthe-et-Moselle, en Lorraine. La mine a été exploitée de 1874 jusqu\'à 1968.\", \"date_updated\": \"2022-04-04T10:05:06.410Z\", \"user_updated\": \"f8a9bb57-86d6-4978-b676-71e27d1e5ee0\"}',	NULL),
